clear;
ValidationData = load("Data/M6M5ID_Test3_both_compensated.mat"); %[output:7f7bd0c2]
ValidationData = ValidationData.data;

%%
% Search for testing times via force plate z readings:
FPz = ValidationData{3}.Values;

Start_times = [];
End_times = [];
valid = false;
for i =1:length(FPz.Data)
    if valid
        if FPz.Data(i)>-5
            End_times = [End_times, FPz.Time(i)-2]; % Chop off the robot being picked up
            valid = false;
        end    
    else
        if FPz.Data(i)<-30
            Start_times = [Start_times, FPz.Time(i)+2];% Chop off the robot being put down
            valid = true;
        end
    end
end
% End_times(5) = End_times(5); % Strange artifact at the end of final sample - something went wring with lifting off the force plate.

%%
% Torques calculated via force plate forces using the jacobian, 
FPy = [];
FPz = [];
MRq = [];
MLq = [];
MRt_read = [];
MLt_read = [];
MRt_cmd = [];
MLt_cmd = [];
ts = 1000;
Start_times =int32(Start_times*ts);
End_times = int32(End_times*ts);



% Resamples
MR_q_resample = resample(ValidationData{5}.Values.q, ValidationData{1}.Values.Time);
ML_q_resample = resample(ValidationData{6}.Values.q, ValidationData{1}.Values.Time);
MR_t_resample = resample(ValidationData{5}.Values.t, ValidationData{1}.Values.Time);
ML_t_resample = resample(ValidationData{6}.Values.t, ValidationData{1}.Values.Time);
MR_t_cmd_resample = resample(ValidationData{9}.Values.tff, ValidationData{1}.Values.Time);
ML_t_cmd_resample = resample(ValidationData{8}.Values.tff, ValidationData{1}.Values.Time);
for i = 1:length(Start_times)
    % Force plate
    FPy = [FPy; ValidationData{2}.Values.Data(Start_times(i): End_times(i))];
    FPz = [FPz; ValidationData{3}.Values.Data(Start_times(i): End_times(i))];
    % Motor angles
    
    MRq = [MRq; MR_q_resample.Data(Start_times(i): End_times(i))];
    MLq = [MLq; ML_q_resample.Data(Start_times(i): End_times(i))];

    % Motor torques (cmd)
    
    MRt_cmd = [MRt_cmd; MR_t_cmd_resample.Data(Start_times(i): End_times(i))]; 
    MLt_cmd = [MLt_cmd; ML_t_cmd_resample.Data(Start_times(i): End_times(i))];
    
    % Motor torques (read)
   
    MRt_read = [MRt_read; MR_t_resample.Data(Start_times(i): End_times(i))];
    MLt_read = [MLt_read; ML_t_resample.Data(Start_times(i): End_times(i))];

end
clear MR_q_resample ML_q_resample MR_t_resample ML_t_resample MR_t_cmd_resample ML_t_cmd_resample
%%
%[text] ## Transfer force plate data into torques
% From the side of forces:
Fy_cmd = [];
Fz_cmd = [];
Fy_read = [];
Fz_read = [];
FP_tl = [];
FP_tr = [];
VL_Fz_cmd = [];
[J11, J12, J21, J22] = BalekaJacobianXY(MLq, MRq);
for i = 1:length(MLt_cmd)
    Jxy = [J11(i), J12(i); J21(i), J22(i)];
    JTxy = Jxy';

    FP_t = JTxy*[FPy(i); FPz(i)];
    FP_tl = [FP_tl, FP_t(1)];
    FP_tr = [FP_tr, FP_t(2)];
    % 
    F_cmd = JTxy\[MLt_cmd(i); MRt_cmd(i)];
    Fy_cmd = [Fy_cmd; -F_cmd(1)];
    Fz_cmd = [Fz_cmd; -F_cmd(2)];

    F_read = JTxy\[MLt_read(i)*9*0.198; MRt_read(i)*9*0.198];
    Fy_read = [Fy_read; F_read(1)];
    Fz_read = [Fz_read; F_read(2)];
end
clear F_cmd F_read i J11 J12 J22 J21 times ts JTxy Jxy
%%
my_tune = 0.6663 %[output:0f5d1160]
cy_tune = -10.6614 %[output:9ede34eb]
mx_tune = 0.5543 %[output:4cd0f79c]
cx_tune = -1.0796 %[output:86527335]


Fz_read_comp = my_tune*Fz_read +cy_tune;
Fy_read_comp = mx_tune*Fy_read + cx_tune;


MSE_F_hor_ReadM6M5_uncompensated =  mean((Fy_read - FPy).^2) %[output:53e2398b]
MSE_F_vert_ReadM6M5_uncompensated =  mean((Fz_read - FPz).^2) %[output:63e6d494]


MSE_F_hor_ReadM6M5_compensated =  mean((Fy_read_comp - FPy).^2) %[output:3d355fc0]
MSE_F_vert_ReadM6M5_compensated =  mean((Fz_read_comp - FPz).^2) %[output:27fbcc74]
