plot(FPz) %[output:6bc7c77f]
hold on %[output:6bc7c77f]
% plot(Fz_cmd)
plot(Fz_read) %[output:6bc7c77f]
plot(Fz_read_comp) %[output:6bc7c77f]
legend('Force plate Fz', 'Motor read Fz', 'Compensated Motor read Fz'); %[output:6bc7c77f]
title('Vertical force plate vs read') %[output:6bc7c77f]
hold off %[output:6bc7c77f]


plot(FPy) %[output:6e76bd16]
hold on %[output:6e76bd16]
% plot(Fz_cmd)
plot(Fy_read) %[output:6e76bd16]

plot(Fy_read_comp) %[output:6e76bd16]
legend('Force plate Fy', 'Motor read Fy', 'Compensated Motor read Fy'); %[output:6e76bd16]
title('Horizontal plate vs read') %[output:6e76bd16]
hold off %[output:6e76bd16]

