hold on %[output:6538a3c4]
plot(t, Fz_read_comp(t1:t2), LineWidth=linwidth, LineStyle='--', Color='#004488') %[output:6538a3c4]
plot(t, Fz_read(t1:t2), LineWidth=linwidth, LineStyle='--', Color='#DDAA33') %[output:6538a3c4]
legend('Force plate measurement', 'Compensated motor sensed force', 'Uncompensated motor sensed force'); %[output:6538a3c4]
title('Sample of compensated vertical sensed forces [M6, M5]') %[output:6538a3c4]
axis([0 20 -inf inf]) %[output:6538a3c4]

xlabel("Time (s)") %[output:6538a3c4]
ylabel("Force (N)") %[output:6538a3c4]
hold off %[output:6538a3c4]

linwidth = 1.5;
t = linspace(0, length(FP_tr(t1:t2))/1000, length(FP_tr(t1:t2)));
plot(t, FPy(t1:t2), LineWidth=linwidth, LineStyle='-', Color='#BB5566') %[output:1a41f8c3]
hold on %[output:1a41f8c3]
plot(t, Fy_read_comp(t1:t2), LineWidth=linwidth, LineStyle='--', Color='#004488') %[output:1a41f8c3]
plot(t, Fy_read(t1:t2), LineWidth=linwidth, LineStyle='--', Color='#DDAA33') %[output:1a41f8c3]
legend('Force plate measurement', 'Compensated motor sensed force','Uncompensated motor sensed force'); %[output:1a41f8c3]
title('Sample of compensated horizontal sensed forces [M6, M5]') %[output:1a41f8c3]
axis([0 20 -inf inf]) %[output:1a41f8c3]
xlabel("Time (s)") %[output:1a41f8c3]
ylabel("Force (N)") %[output:1a41f8c3]
hold off %[output:1a41f8c3]
